window.bookSummaryJSON = "<p>Experience the magic of the season with the small-town, enemies to lovers Christmas romance \"The Christmas War Paws.\"</p> <p>Dr. Francesca Johnson-DeWitt is ready for a Bahamian Christmas vacation, but her post-divorce plans take an unexpected turn when fate intervenes. In the charming town of Ohio Falls, her college nemesis, the smug Dr. Sebastian Bing, rekindles an old rivalry, sparking a hilarious and heartwarming Christmas War that turns the quaint town upside down.</p> <p>Join the festive chaos in this delightful, heated, rom-com novella filled with pranks, pie, forgiveness, and unexpected love.</p>"; 
